import sys
import os
import requests
from skills import *

from dotenv import load_dotenv
import psycopg2
import pandas as pd
import matplotlib.pyplot as plt


def plot_population_by_admin1(country_code, output_file):
    # Load environment variables
    load_dotenv()

    # Connect to the database
    conn = psycopg2.connect(
        host=os.getenv(''POSTGRES_DATA_HOST''),
        port=os.getenv(''POSTGRES_DATA_PORT''),
        dbname=os.getenv(''POSTGRES_DATA_DB''),
        user=os.getenv(''POSTGRES_DATA_USER''),
        password=os.getenv(''POSTGRES_DATA_PASSWORD'')
    )

    # Write the SQL query
    sql = f"""
    SELECT adm1_name, SUM(population) as population
    FROM hapi_population_social_population
    WHERE adm0_code = ''{country_code}''
    GROUP BY adm1_name
    ORDER BY population DESC
    """

    # Execute the SQL query and fetch the results
    cur = conn.cursor()
    cur.execute(sql)
    rows = cur.fetchall()
    print(f"Size of the results: {len(rows)}")

    # Convert the results into a DataFrame
    df = pd.DataFrame(rows, columns=["adm1_name", "population"])

    if df.empty:
        print("No data found for the given country code.")
        return

    df[''population''] = df[''population''].astype(int)

    # Convert population to millions
    df[''population''] = df[''population''] / 1000000

    # Plot the bar chart
    df.plot(kind=''bar'', x=''adm1_name'', y=''population'', title=f''Population of {country_code} by Admin 1'')
    plt.xlabel(''Admin 1'')
    plt.ylabel(f''Population (Millions)'')

    # Save the chart to a .png file
    print(f"Saving the plot to: {output_file}")
    plt.savefig(output_file)

